export default function LeagueSelection({
  leagues,
  handleLeagueChange,
  handleLeagueConfirm,
  confirmedLeague,
  handleShowRosters,
  handleLeagueButton,
}) {
  return (
    <>
      {leagues.length > 0 && (
        <div>
          <h4 htmlFor="leagues">Select a League:</h4>
          <select onChange={handleLeagueChange}>
            {leagues.map((league) => (
              <option key={league.league_id} value={league.league_id}>
                {league.name}
              </option>
            ))}
          </select>
          <button onClick={handleLeagueConfirm}>Confirm League</button>
          {confirmedLeague && (
            <button onClick={handleShowRosters}>Show Rosters</button>
          )}
          {confirmedLeague && (
            <button onClick={handleLeagueButton}>Start Trade Analysis</button>
          )}
        </div>
      )}
    </>
  );
}
